import React from 'react';
import '../styles/dashboard.css';



function Dashboard() {
    return (
        <div className="flex h-screen">
          <div className="w-1/4 bg-red-500"></div>
          <div className="w-3/4 bg-white"></div>
        </div>
      );
    }

export default Dashboard;
